import React from 'react';
import { ResponsiveContainer } from 'recharts';

const fetchData = () => {
  return fetch("http://localhost:5000/SongWorld/Songworld")
        .then((response) => response.json())
        .then((data) => console.log(data));}

export default function Song() {
 

  return (
    <React.Fragment>
      <h1>Today</h1>
      
         <des>
          meta={fetchData}
        </des>
    </React.Fragment>
  );
}
